import React from 'react'
import { withTranslation } from 'react-i18next'
import './VoteMenu.less'

class VoteMenu extends React.Component {
  render() {
    const {
      props: { handleChoiceMenu, i18n }
    } = this
    return (
      <>
        <ul className='vote-menu'>
          <li
            className='menu-item'
            onClick={() => handleChoiceMenu('multipleQuestion')}
          >
            <p>{i18n.t('multipleChoice')}</p>
          </li>
          <li
            className='menu-item'
            onClick={() => handleChoiceMenu('truefalseQuestion')}
          >
            <p>{i18n.t('y/nChoice')}</p>
          </li>
        </ul>
        <p className='vote__foot'>{i18n.t('selectTypePoll')}</p>
      </>
    )
  }
}

export default withTranslation()(VoteMenu)
